import React from "react";
import head from "./sprites/head.png";
import tail from "./sprites/tail.png";
import belly from "./sprites/belly.png";

const SnakeBody = props => {
  return (
    <div>
      {props.snakeDots.map((dot, i) => {
        let element = belly;

        if (props.snakeDots[i] === 0) {
          element = tail;
        }
        const style = {
          left: `${dot[0] * 10}px`,
          top: `${dot[1] * 10}px`
        };
        return (
          <div className={element} key={i} style={style}>
            <img src={head} key={i} alt="" />
          </div>
        );
      })}
    </div>
  );
};

export default SnakeBody;
